import styled from "styled-components"

const Container = styled.div`
height: 60px;

`;

const Wrapper = styled.div`
padding: 10px 20px;
display: flex;
justify-content: space-between;
align-items: center;

`;

const Left = styled.div`
flex: 1;
`;
const Center = styled.div`
flex: 1;
`;
const Right = styled.div`
flex:1;
`;

const Navbar = () => {
  return (
    <Container>
        <Wrapper>
            <Left>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eos quis repudiandae quam neque molestias maxime accusamus, quisquam mollitia unde voluptatem ratione ex deserunt, sit nesciunt perspiciatis beatae, eius cum reiciendis?</Left>
            <Center>Center</Center>
            <Right>Right</Right>
        </Wrapper>
    </Container>
  )
}

export default Navbar
